import React from 'react';
import Header from "../components/common/Header";
import style from "../styles/offlineorder.css";
import shop from "../assets/image/shop.png";
export default class OfflineOrder extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {

        }
    }
    componentDidMount() {

    }

    render() {
        return (
            <div>
                <Header/>
                <div className={style.container}>
                    <div className={style.item}>
                        <p className={style.order_number}>
                            <span>订单号：602934253603 拷贝</span>
                            <button>待确认</button>
                        </p>
                        <div className={style.containers}>
                            <div className={style.image}>
                                <img src={shop}/>
                            </div>
                            <div className={style.content}>
                                <p>DrF-高型房车</p>
                                <p>已认筹：4份</p>
                                <p className={style.price}>单价：20000.00元／份</p>
                            </div>
                            <div className={style.right_price}>
                                <p>¥80000.00</p>
                            </div>
                        </div>
                    </div>
                </div>
                <p className={style.totalorders}>订单总额：¥80000.00</p>
                <div className={style.userInfo}>
                    <p>用户姓名：欧阳</p>
                    <p>用户手机号：155-2790-4092</p>
                    <p>邀请人手机号：130-0611-1487</p>
                </div>
            </div>
        )
    }

}
